// Assignments.js
import React from 'react';

const Assignments = () => {
  return (
    <section>
      <h2>Assignments</h2>
      <ul>
        <li>Assignment 1: Due on DD/MM/YYYY</li>
        <li>Assignment 2: Due on DD/MM/YYYY</li>
        <li>Assignment 3: Due on DD/MM/YYYY</li>
      </ul>
    </section>
  );
};

export default Assignments;
